import Timer from "./components/Timer";

const App = () => {
  return (
    <div>
    <div className="todo-container">
      {/* <CounterComponent/> */}
      <Header />
      <Item name="Eat"/>
      <Item completed={true} name="Sleep"/>
      <Item name="Code"/>
      <Item name="Drink"/>
      <Item name="Class"/>
      <Button/>
      <Timer/>
    </div>
    </div>
  );
};

export default App;
